import React from "react";
import "../App.css";

export const Menu = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col order-last">
          
          <h1> Libros Disponibles</h1>
          <button >Minky te amo </button>
        </div>

        <div className="col order-medio">
          <ul></ul>
          <h1> Registrar Libro Prestado</h1>
          <p>Minky te amo </p>
        </div>

        <div className="col order-first">
          <ul>
            <h1> Libros Prestados</h1>
            <p>Minky te amo </p>
          </ul>
        </div>
      </div>
    </div>
  );
};
